import React from 'react';

function ContactSlip() {
// 151C29,647692,4199E0,4CB1F3

    const contactSlipCont = {
        background: '#4199E0',
        color: '#eee',
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
        height: '30vw',
        maxHeight: '800px',

        padding: '2vw',
    }

    const leftBlock = {
        width: '50%',
        height: '100%',
        borderRight: '1px solid #151C29'
    }

    const rightBlock = {
        width: '50%',
        height: '100%',
        display: 'flex',
        flexDirection: 'column',
    }

    const topBlock = {
        backgroundColor: 'red',
        display: 'flex',
        alignItems: 'center',
        height: '50%',
        margin: '0 0 10px 30px',
    }

    const bottomBlock = {
        backgroundColor: 'green',
        display: 'block',
        height: '50%',
        margin: '10px 0 0 30px',
    }

    const imgContTop = {
        backgroundColor: 'yellow',
        display: 'block',
        height: '100%',
        width: '15vw',
    }

    const imgContBottom = {
        backgroundColor: 'yellow',
        display: 'block',
        height: '100%',
        width: '15vw',
    }

  return (
    <div className="contactSlip" style={ contactSlipCont }>
        <div style={ leftBlock }>
            Contact Us
        </div>
        <div style={ rightBlock }>
            <div style={ topBlock } className="bl">
                <div style={ imgContTop }>
                    <img src="./images/jack.jpg" alt="Jack Mencia CEO"/>
                </div>
            </div>
            <div style={ bottomBlock }>
                <div style={ imgContBottom }></div>
            </div>
        </div>
    </div>
  );
}

export default ContactSlip;
